package com.testwa.core.cmd;import lombok.Data;import lombok.ToString;@Data@ToStringpublic class ScriptInfo {    private Long id;    private String scriptName;    private String aliasName;    private String appPackage;    private String size;    private String tag;    private String description;    private String md5;    private String path;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getScriptName() {        return scriptName;    }    public void setScriptName(String scriptName) {        this.scriptName = scriptName;    }    public String getAliasName() {        return aliasName;    }    public void setAliasName(String aliasName) {        this.aliasName = aliasName;    }    public String getAppPackage() {        return appPackage;    }    public void setAppPackage(String appPackage) {        this.appPackage = appPackage;    }    public String getSize() {        return size;    }    public void setSize(String size) {        this.size = size;    }    public String getTag() {        return tag;    }    public void setTag(String tag) {        this.tag = tag;    }    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }    public String getMd5() {        return md5;    }    public void setMd5(String md5) {        this.md5 = md5;    }    public String getPath() {        return path;    }    public void setPath(String path) {        this.path = path;    }}